import React from 'react'
import { useState } from 'react';

const StartScreen: React.FC = () => {
    const [isStarted, setIsStarted] = useState(false);

    const onStartClick = () => {
      setIsStarted(true);
      history.push("/quiz"); // Usa history per navigare alla rotta "/quiz"
    };

    return (
      <div className="StartScreen">
        <h2>Quiz sul turismo sostenibile</h2>
        <p>
          In questo quiz potrai testare le tue conoscenze sul turismo sostenibile.
          Rispondi alle domande e scopri il tuo livello di "skill"!
        </p>
        <button onClick={onStartClick}>Inizia</button>
      </div>
    );
  };


export default StartScreen
